  function widget_init() {
	//console.debug('css')
	let widgetInterval = setInterval(() => {
	  if (document.readyState === 'complete') {
		setTimeout(() => {
			loadCss();
			setTimeout(() => {
				document.querySelector(".cpwebchatHolder #app").style.visibility = "visible";
			  }, 500)
		  }, 1000)
		init();
		//console.debug('init')
		clearInterval(widgetInterval);
	  }
	}, 1000);
  }
  
  setTimeout(() => {
	widget_init();
  }, 100);
  
	
	